import React from 'react';
import StockAggregator from './components/StockAggregator';

function App() {
  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1>Stock Price Aggregator</h1>
      <StockAggregator />
    </div>
  );
}

export default App;
